class guid{static short(){var x=new Date().getTime();return"xxxxxxxx".replace(/[x]/g,function(r){var t=(x+16*Math.random())%16|0;return x=Math.floor(x/16),("x"==r?t:3&t|8).toString(16)})}static long(){var x=new Date().getTime();return"xxxxxxxx-xxxx-xxxx-xxxx-xxxxxxxxxxxx".replace(/[x]/g,function(r){var t=(x+16*Math.random())%16|0;return x=Math.floor(x/16),("x"==r?t:3&t|8).toString(16)})}static any(x){let r=x;"number"==typeof x&&(r="x".repeat(x));var t=new Date().getTime();return r.replace(/[x]/g,function(x){var r=(t+16*Math.random())%16|0;return t=Math.floor(t/16),("x"==x?r:3&r|8).toString(16)})}}